function EmbedSlangStudio(el: HTMLElement, blueprintFullName: string) {
    const app = new AppModel();
    const mainComponent = new MainComponent(app, el);

    new StaticStorageComponent(app, operators.objects as Array<BlueprintApiResponse>);

    mainComponent.load().then(() => {
        app.getLandscape().findBlueprint(blueprintFullName)!.open();
    });
}

const elements = document.getElementsByClassName("slang-embedded");
for (const el of elements) {
    if (el instanceof HTMLElement) {
        EmbedSlangStudio(el, el.dataset['blueprint'] as string);
    }
}